INSERT INTO `p2erls_ecosystems` VALUES ('AGRI','No',0,'','2008-01-24 12:11:51','Agricultural','Where land is used for agriculture'),('ALPINE','No',0,'','2007-11-01 13:25:33','Tundra-Alpine','Located on mountains throughout the world at high altitude where trees cannot grow.'),('ANTARCTIC','No',0,'','2008-06-03 15:39:06','Antarctic',''),('AQUATIC','No',0,'','2007-11-01 13:26:15','Aquatic-freshwater','Aquatic regions with a low salt concentration, usually less than 1%.'),('ARCTIC','No',0,'','','Tundra-Arctic','located in the northern hemisphere, encircling the north pole and extending south to the coniferous forests of the taiga.'),('COASTAL-BOREAL','No',0,'','2008-06-16 12:08:55','Boreal Coastal','Coastal areas in the Boreal region'),('COASTAL-DESERT','No',0,'','2008-06-16 13:44:53','Desert Coastal','Coastal area in desert region'),('COASTAL-TEMP','No',0,'','2008-06-16 12:08:23','Temperate Coastal','Coastal areas in the temperate zone'),('COASTAL-TROP','No',0,'','2008-06-16 12:09:29','Tropical Coastal','Coastal areas in the subtropics and tropics'),('CORAL','No',0,'','','Coral reefs','widely distributed in warm shallow waters.'),('DESERT-COLD','No',0,'','','Cold desert','characterized by cold winters with snowfall and high overall rainfall throughout the winter and occasionally over the summer.'),('DESERT-HOT','No',0,'','','Hot desert','warm throughout the year and very hot in the summer, winters usually bring little rainfall.'),('ESTU','No',0,'','','Estuaries','where freshwater streams or rivers merge with the ocean.'),('GRASS-SHRUB','No',0,'','','Grassland-Shrubland','characterized as having grasses as the dominant vegetation. Trees and large shrubs are absent.'),('OCEAN','No',0,'','','Ocean','very large bodies of water that dominate the Earth\'s surface.'),('PASTURE','No',0,'','','Pasture','open cultivated region over which livestock roam and feed'),('PRAIRIE','No',0,'','2008-06-03 15:54:43','Prairie','An area of land of low topographic relief that historically supported grasses and herbs, with few or no trees, and having generally a mesic climate (http://en.wikipedia.org/wiki/Prairie).'),('RANGE','No',0,'','','Rangeland and pastures','open natural region over which livestock roam and feed'),('SAGEBRUSH','No',0,'','','Sagebrush Steppe','dry habitat characterized by sagebrush and other shrubs and short grasses.'),('SAVANNA','No',0,'','','Savanna','grassland with scattered individual trees.'),('SEMIARID','No',0,'','','Semiarid desert','summers are moderately long and dry, and like hot deserts, the winters normally bring low concentrations of rainfall.'),('SHORTGRASS','No',0,'','','Shortgrass Steppe','dominated by short grasses, with very few dwarf shrubs'),('TEMPFOR','No',0,'','','Temperate forest','Well-defined seasons with a distinct winter.'),('TIAGA','No',0,'','','Tiaga (Boreal forest)','between 50 and 60 degrees north latitudes, seasons are divided into short, moist, and moderately warm summers and long, cold, and dry winters.'),('TROPFOR','No',0,'','2008-01-24 11:25:48','Tropical forest','occur near the equator, within the area bounded by latitudes 23.5 degrees N and 23.5 degrees S. only two seasons are present (rainy and dry). '),('URBAN','No',0,'','','Urban','relating to or concerned with a cities or densely populated area'),('WETLAND','No',0,'','','Wetland','Regions between aquatic and terrestrial systems, where the soil is saturated at least some of the time.');
/*!40000 ALTER TABLE `p2erls_ecosystems` ENABLE KEYS */;
UNLOCK TABLES;

