ulated because it\'s relatively inaccessible, and commercial development has been actively discouraged by its residents. Approximately 150 people spend their winters on the island. The population swells to more than 10 times that number during the summer.','ESTU','RI','US',''),('NRMR','No',0,'','','Kenneth S. Norris Rancho Marino Reserve','http://nrs.ucop.edu/Kenneth-Norris-Rancho-Marino.htm',35.542149,-121.089299,0,216,108,17.5,46,NULL,'COASTAL-TEMP','CA','US',''),('NSNWR','No',0,'','2008-06-10 15:30:40','Neal Smith National Wildlife Refuge','http://www.fws.gov/refuges/profiles/index.cfm?id=33670',41.558,-93.28,244,280,262,9.5,84.8,'','PRAIRIE','IA','US','Neal_Smith_National_Wildlife_Refuge.pdf'),('NTK','No',0,'','2007-10-30 13:45:26','Noatak National Preserve','http://www.nps.gov/noat/',67.3,-162,0,1500,750,-5.7,25.5,'','ARCTIC','AK','US',''),('NTL','No',0,'','2008-06-03 18:50:10','North Temperate Lakes','http://lter.limnology.wisc.edu/',46,-89.7,0,0,0,4.4,79,'','AQUATIC','WI','US',''),('NTS','No',0,'','','Nevada Desert Research Center','http://www.unlv.edu/Climate_Change_Research/',36.76,-115.99,960,975,967.5,17.3,15,NULL,'GRASS-SHRUB','NV','US',''),('NWRC','No',0,'','','Northwest Watershed Research Center','http://ars.usda.gov/Main/site_main.htm?modecode=53-62-00-00',43.603977,-116.190149,NULL,NULL,NULL,NULL,NULL,NULL,'TEMPFOR','ID','US',''),('OAK','No',0,'','2008-04-11 13:01:23','Oak Lake Biological Field Station','http://biomicro.sdstate.edu/Oaklake/index.htm',44.505,-96.532,549,573,561,5.9,58.3,'','WETLAND','SD','US','Oak_Lake_Biological_Field_Station.pdf'),('OBFS','No',0,'','','Oneonta Biological Field Station','http://www.oneonta.edu/academics/biofld/',42.75,-74.83,NULL,NULL,NULL,NULL,NULL,NULL,'AQUATIC','NY','US',''),('OBS','No',0,'','','University of Oklahoma Biological Station','http://www.ou.edu/uobs/',33.9982,-96.8034,NULL,NULL,210,16.5,107.1,NULL,'TEMPFOR','OK','US',''),('OCR','No',0,'','2008-04-11 11:52:36','Onion Creek Experimental Forest ','http://