ion of Mobile Bay. This sub-estuary of Mobile Bay averages just 4.8 ft deep (1.5 meters) and is fringed with marsh (Spartina, Juncus) and swamp (pine, oak, magnolia, maple, cypress, bayberry, tupelo and others). The reserve lands also include upland and bottomland hardwood forests, freshwater marsh (Typha, Cladium), submerged aquatic vegetation (Ruppia, Valisneria) and unique bog habitats (Sarracenia, Drosera). Weeks Bay is a critical nursery for shrimp, bay anchovy, blue crab and multitudes of other fish, crustaceans and shellfish that support robust commercial fisheries providing $450 million/year for Alaba','ESTU','AL','US',''),('WEFS','No',0,'','','Woodlake Environmental Field Station','http://www.csuohio.edu/ei/woodlake.html',41.23,-81.52,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'OH','US',''),('WEO','No',0,'','','Wolfskill Experimental Orchards','http://www.plantsciences.ucdavis.edu/pomology/dept/facilities.htm#OG',38.54,-121.75,NULL,NULL,14,NULL,NULL,NULL,'AGRI','CA','US',''),('WEW','No',0,'','2008-04-11 11:39:35','West Eugene Wetlands','http://www.eugene-or.gov/portal/server.pt?space=CommunityPage',44.212,-122.56,100,177,138.5,11.3,102,'','WETLAND','OR','US','West_Eugene_Wetlands.pdf'),('WFS','No',0,'','2008-04-09 16:55:30','Woodworth Field Station','http://www.npwrc.usgs.gov/about/facility.htm',47.136,-99.244,NULL,NULL,NULL,5.4,47,'','WETLAND','ND','US','Woodworth_Field_Station.pdf'),('WFWA','No',0,'','','Whittell Forest and Wildlife Area','http://www.cabnr.unr.edu/littlevalley/',39.275,-119.878,1900,2500,2200,NULL,NULL,NULL,'TEMPFOR','NV','US',''),('WGW','No',0,'','','Walnut Gulch Experimental Watershed','http://www.tucson.ars.ag.gov/unit/gis/wg.html',31.7058,-110.0571,1250,1585,1417.5,17.7,35,NULL,'GRASS-SHRUB','AZ','US',''),('WHTKF','No',0,'','','Whitaker Forest Research Station','http://ecology.cnr.berkeley.edu/properties/whitaker.html',36.71,-118.94,NULL,NULL,109.2,NULL,NULL,NULL,'TEMPFOR','CA','US',''),('WIN','No',0,'','2008-04-11 11:44:52','Wind River Exper